import React, { useEffect } from "react";

function ViewCustomers(){

    useEffect(() => {
        fetch(process.env.REACT_APP_API + "/user")
        .then(res => {
            if (!res.ok){
                throw new Error("Request failed with status: " + res.status);
            }
            return res.json();
        })
        .then(data => {
            console.log(data);
        })
        .catch(error => {
            console.error("Error: " + error)
        })
    })

    return(
        <div className="ViewCustomers">
            <div className="content-main">
              <form id="viewCustomers">
                <label>ID:</label>
                <input type="text" id="id" className="text-input"/>
                <label>Name:</label>
                <input type="text" id="name" className="text-input"/>
                <label>Email:</label>
                <input type="text" id="email" className="text-input"/>
                
                <label>User:</label>
                <input type="text" id="user" placeholder="user" className="text-input"/>
                <label>Order Code:</label>
                <input type="text" id="orderCode" placeholder="OrderCode" className="text-input"/>
                <label>Address:</label>
                <input type="text" id="address" placeholder="Address" className="text-input"/>
                <button type="submit">Create</button>
            </form>
          </div>
        </div>
    );
}

export default ViewCustomers;
